import {useState, useEffect } from 'react';

const Product = () => {
    const[product, setProducts] = useState([]);
    const categories = [
        {name: "new closthing",api:"https://fakestoreapi.com/products/category/men's clothing"},
        {name: "Best closting",api:"https://fakestoreapi.com/products/category/men's clothing"},
        {name: "Last closting",api:"https://fakestoreapi.com/products/category/men's clothing"},
    ];
    const handleFilterClick = (filter) => {
        setActiveFilter(filter);};
    useEffect(() => {
        const fetchProducts = async () => {
            try {
                const categoryPromises = categories.map(async (category) => {
                    const response = await fetch(category.api);
                    const data = await response.json();
                    return {
                        category: category.name,
                        products: data.slice(0, 4),
                    };
                });

                const results = await Promise.all(categoryPromises);
                setProducts(results);
            } catch (error) {
                console.error('Error fetching products:', error);
            }
        };

        fetchProducts();
    }, []);
    const handleAddToCart = (product) => {
        addToCart(product);
    };

    const handleSearchClick = (product) => {
        navigate(`/${currentLanguage}/shop-details`, { state: { product } });
    };
  

  return (
    <div>
            {/* <!-- Product Section Begin --> */}
    <section class="product spad">
        <div class="container">
            <div class="row">
                <div class="col-lg-12">
                    <ul class="filter__controls">
                    <li
                            key={category.name}
                            className={activeFilter === category.name ? 'active' : ''}
                            // onClick={() => handleFilterClick(category.name)}
                            >
                            
                        </li>                        
                    </ul>
                </div>
            </div>
            <div class="row product__filter"> 
            {product
                .filter((categoryData) => activeFilter === categoryData.category)
                .map((categoryData, index) =>
                    categoryData.products.map((product) => (
                        <div key={product.id} className="col-lg-3 col-md-6 col-sm-6 mix">
                                        <div className="product__item">
                                            <div
                                                className="product__item__pic set-bg"
                                                style={{
                                                    backgroundImage: `url(${product.image})`,
                                                    backgroundSize: 'contain',
                                                    backgroundRepeat: 'no-repeat',
                                                    backgroundPosition: 'center',
                                                    height: '200px',
                                                    width: '100%',
                                                }}>
                                                <ul className="product__hover">
                                                    <li>
                                                        <a href="#">
                                                            <img src={heart} alt="Heart Icon" />
                                                        </a>
                                                    </li>
                                                    <li>
                                                        <a href="#">
                                                            <img src={compare} alt="Compare Icon" />
                                                            <span>Compare</span>
                                                        </a>
                                                    </li>
                                                    <li><a onClick={() => handleSearchClick(product)}><img src={search} alt="" style={{ cursor: 'pointer' }} /><span>{'View details'}</span></a></li>
                                                </ul>
                                            </div>
                                            <div className="product__item__text">
                                                <h6>{product.title}</h6>
                                                <a style={{ cursor: 'pointer' }} onClick={() => handleAddToCart(product)} class="add-cart">+ Add To Cart</a>
                                                <div className="rating">
                                                    <i className="fa fa-star-o"></i>
                                                    <i className="fa fa-star-o"></i>
                                                    <i className="fa fa-star-o"></i>
                                                    <i className="fa fa-star-o"></i>
                                                    <i className="fa fa-star-o"></i>
                                                </div>
                                                <h5>${product.price}</h5>
                                            </div>
                                        </div>
                                    </div>
                                ))
                            )}
            
            </div>
        </div>
    </section>
    {/* <!-- Product Section End --> */}
    </div>
  )
}

export default Product
